import React from "react";
import HeaderClass from "./components/Header";
import Image from "./components/Image";
import logo from "./img/logo.png";

class AppClass extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            Text: "help text",
            userData: "",
        }
    }
    Text = "help text";
    h1 = "Hello World!!!";
    sometext = "texts".length;

    componentDidUpdate(prevProp){
        if(this.state.Text != "help text")
            console.log('Some')
        
    }

    render(){
        return(
            <div className="name">
            <HeaderClass title="Шапка сайта" />
            <HeaderClass title="Шапка сайта!!!" />
            <HeaderClass title="!!!" />
            <h1>{this.h1}</h1>
            <h2>{this.state.Text}</h2>
            <h3>{this.state.userData}</h3>
            <input placeholder={this.state.Text} onChange={event => this.setState({userData: event.target.value})} onClick={this.inputClick} onMouseEnter={this.inputEnter}/>
            <p>{1 + 4}</p>
            <p>{5 === this.sometext ? "Hello" : "Friend"}</p>
            <Image title={logo} className="images"/>
            <img src={logo}/>
        </div>
        )
    }

    inputClick = () => {
        this.setState({Text: "help me"})
        console.log("Clicked")
    };
    
    inputEnter = () => console.log("Mouse Over");

  
}
export default AppClass;
